import react from "react";
function Footer() {
  return (
    <footer>
      <p
        style={{
          position: "fixed",
          left: 0,
          bottom: 0,
          width: "100%",
          textAlign: "center"
        }}
      >
        Copyright @2023
      </p>
    </footer>
  );
}
export default Footer;
